RAWALPINDI, Feb 17 (APP):US Special Representative for Afghan Reconciliation Zalmay Khalilzad Monday called on Chief of Army Staff (COAS) General Qamar Javed Bajwa here at General Headquarters.
During the meeting, matters of mutual interest including overall regional security situation and ongoing Afghan Reconciliation Process were discussed, an Inter Services Public Relations (ISPR) press release said.
